    return(
        <div>
            <ul className="list-group">
                {
                    myModules.map(module =>
                        <li className="list-group-item">
                            {module.title}
                            <i className="float-right fa fa-trash"></i>
                        </li>
                    )
                }
            </ul>
        </div>
    )
}

